import { Box, Typography } from "@mui/material";
import WidgetContainer from "components/WidgetContainer";
import React from "react";

const FriendList = () => {
  return (
    <WidgetContainer>
      <Typography
        variant="subtitle2"
        sx={"fontWeight:500px"}
        pb="10px"
      ></Typography>
      ;
    </WidgetContainer>
  );
};

export default FriendList;
